Superman v2 #182
Publisher:  DC Comics
Publication Date:  July 2002

Writer:  Jeph Loeb
Penciller:  Ed McGuinness
Inker:  Cam Smith
Colorist:  Tanya Horie and Rich Horie
Letterer:  Richard Starkings
Cover Artist:  Ed McGuinness, Cam Smith, Tanya Horie, and Rich Horie

Guest-starring the all-new Suicide Squad! Lois starts digging up information on President Luthor and uncover the existence of the Squad, leading to a confrontation between the Man of Steel and a team that's willing to die to keep its secret.

Thanks goes to DreamGirl for this release.

